//Bootstrap and jQuery libraries

// import "jquery/dist/jquery.min.js";

// import "datatables.net-dt/js/dataTables.dataTables";
// import "datatables.net-dt/css/jquery.dataTables.min.css";
// import $ from "jquery";
import React, { useEffect } from "react";
export const MyTabel = () => {
  useEffect(() => {
    // $("#Customer_table").DataTable({
    //   responsive: true,
    //   deferRender: true,
    //   scroller: true,
    // });
  }, []);
  const ListData = [
    {
      CustomerID: "MMCR111",
      date: "22-02-22",
      CustomerType: "Payment Setup",
      PhoneNumber: "Salary Transfer, Tax Payment, PF, ESI",
    },
  ];
  const ListApp = (props) => {
    return (
      <tr>
        <th scope="row">{props.CustomerID}</th>
        <td>{props.date}</td>
        <td>{props.CustomerType}</td>
        <td>{props.PhoneNumber}</td>
      </tr>
    );
  };
  return (
    <>
      <div>
        <table
          id="Customer_table"
          className="table-striped table-hover  table MyTabel_top_div"
        >
          <thead>
            <tr>
              <th scope="col">Customer ID</th>
              <th scope="col">Date</th>
              <th scope="col">Customer Type</th>
              <th scope="col">Name</th>
              <th scope="col">Email Id</th>
              <th scope="col">Phone Number</th>
              <th scope="col">Action</th>
              <th scope="col">Delete</th>
              <th scope="col">More Details</th>
            </tr>
          </thead>
          <tbody>
            {ListData.map((val, i) => {
              return (
                <ListApp
                  key={i}
                  CustomerID={val.CustomerID}
                  date={val.date}
                  CustomerType={val.CustomerType}
                  PhoneNumber={val.PhoneNumber}
                />
              );
            })}
          </tbody>
        </table>
      </div>
    </>
  );
};
